import "./Main.css";
import PizzaDescription from "../components/pizza-description";
import BoyutSec from "../components/boyut-sec";
import HamurSec from "../components/HamurSec";
import EkMalzemeler from "../components/EkMalzemeler"
import SiparisNotu from "../components/SiparisNotu"
import Counter from "../components/Counter";
import SiparisToplami from "../components/SiparisToplami";

function Main() {
    return (
        <>
        <div class="header">
            <h1>Teknolojik Yemekler</h1>
            <nav>
                <p>Anasayfa Seçenekler Sipariş Oluştur</p>
            </nav>
        </div>

        <div class="order">
            <PizzaDescription />
            <BoyutSec />
            <HamurSec />
            <EkMalzemeler />
            <SiparisNotu />
            <Counter />
            <SiparisToplami />
        </div>
        </>
    )
}

export default Main;
